import React from "react";
import { Button, SafeAreaView, StyleSheet, TextInput } from "react-native";
import { idNumber, productDetails } from "./Data";

const NewProduct = () => {
  const [text, onChangeText] = React.useState("Product Name");
  const [number, onChangeNumber] = React.useState("Amount");

  return (
    <SafeAreaView>
      <TextInput
        style={styles.input}
        onChangeText={onChangeText}
        value={text}
      />
      <TextInput
        style={styles.input}
        onChangeText={onChangeNumber}
        value={number}
        keyboardType="numeric"
      />
      <Button title = 'Add to cart' onPress ={() => {alert('works')}} />
    </SafeAreaView>
  );
};


const AddItem = () => {
    idNumber = idNumber + 1;
    productDetails.concat({id: {idNumber}, name : {onChangeText} , amount : {onChangeNumber}});
    onChangeText = "Product Name";
    onChangeNumber = "Amount";
};
const styles = StyleSheet.create({
  input: {
    height: 40,
    margin: 12,
    borderWidth: 1,
    padding: 10,
  },
});

export default NewProduct;
